var app = angular.module('app', ['ngRoute', 'chart.js']);

app.config(function($routeProvider) {
    $routeProvider
    .when("/", {
        templateUrl : "views/home.html",
        controller: 'HomeController',
        controllerAs: 'my'
    })
    .when("/createpoll", {
        templateUrl : "views/createpoll.html",
        controller: 'CreatePollController',
        controllerAs: 'my'
    })
    .when("/mypolls", {
        templateUrl : "views/mypolls.html",
        controller: 'MyPollsController',
        controllerAs: 'my'
    })
    .when("/poll/:id", {
        templateUrl : "views/poll.html",
        controller: 'PollController',
        controllerAs: 'my'
    });
});

app.config(['$httpProvider', function($httpProvider) {
        $httpProvider.defaults.useXDomain = true;
        $httpProvider.defaults.withCredentials = true;
        delete $httpProvider.defaults.headers.common["X-Requested-With"];
        $httpProvider.defaults.headers.common["Accept"] = "application/json";
        $httpProvider.defaults.headers.common["Content-Type"] = "application/json";
    }
]);

//redirect to home 
app.run(function($rootScope, $location, pollServices) {
    $rootScope.$on("$locationChangeStart", function(event, next, current) { 
        if($location.path() == '/createpoll' || $location.path() == '/mypolls') {
            pollServices.info(function(data) {
                if(data) {
                    //console.log('ok change url');
                } else {
                    //console.log('error chnage url');
                    $location.path('/');
                }
            })
        }
    });
});

app.controller('MainController', function($location,  pollServices) {
	var vm = this;
	pollServices.info(function(data) {
		vm.auth = data;
	});
	// vm.labelChart = ['1', '2', '3', '4'];
	// vm.dataChart = ['30, 89', '1', '451']
	
	// vm.info = function() {
	// 	pollServices.info(function(data) {
	// 		vm.auth = data;
	// 	});
	// }
	
	vm.pollFun = function(arg) {
		if(arg == 'auth') {
			var newWin = window.open("https://app-voting-jamaurz.c9users.io/auth/twitter", "_blank", "toolbar=yes,scrollbars=yes,resizable=yes,top=500,left=500,width=400,height=400");
			setTimeout(function() {
		    	newWin.window.close();
		    	window.location.reload();
		    }, 8000);
		} else {
			$location.path(arg);
		}
	}

});
app.controller('HomeController', function($location, pollServices) {
	var vm = this;
	pollServices.allpolls(function(data) {
		//console.log('data home ctrl', data);
		vm.polls = data;	
	});
	
	vm.mypollurl = function(arg) {
		$location.path('/poll/' + arg);
	}
});
app.controller('MyPollsController', function($location, pollServices) {
	var vm = this;
	pollServices.polls(function(data) {
		vm.polls = data;
		//console.log('data async func services', data);
	});
	
	vm.mypollurl = function(arg) {
		$location.path('/poll/' + arg);
	}
});
app.controller('CreatePollController', function($location, pollServices) {
	var vm = this;
	vm.createpollfun = function() {
		if(vm.namePoll && vm.optionsPoll) {
			var options = vm.optionsPoll.split(/\r?\n/);
			pollServices.createpoll(vm.namePoll, options, function(data) {
				if(data) {
					$location.path('/mypolls');
					$location.replace();
					alert('new poll ' + vm.namePoll + ' created successful');
				}
			});
		} 
	}
});
app.controller('PollController', function($location, $routeParams , pollServices) {
	var vm = this;
	vm.dataName = [];
	vm.dataCount = [];
	
	function pollforid() {
		pollServices.pollid($routeParams.id, function(data) {
			vm.poll = data;
			infoCheck();
		
			for (var i = 0; i < data.votes.length; i++) {
				if( i == 0 ) {
					vm.dataName = [];
					vm.dataCount = [];
				}
				//console.log(data.votes[i].name);
				vm.dataName.push(data.votes[i].name); 
				vm.dataCount.push(data.votes[i].count); 
			}
			vm.labels = vm.dataName;
			vm.data = vm.dataCount;
		});
	}
	
	pollforid();
	
	vm.chartOptions = { 
        legend: {
          display: true,
        }
    };
	
	function infoCheck() {
		pollServices.info(function(data) {
			//console.log(data.twitter.id, vm.poll.polls.author, data.twitter.id == vm.poll.polls.author);
			vm.ownPoll = undefined;
			if(data) {
				if(data.twitter.id == vm.poll.polls.author) {
					vm.ownPoll = data.twitter.id;
				} 
			} 
		});
	}
	
	vm.changeOpt = function() {
		if(vm.selected == 'I\'d like a custom option') {
			vm.customopt = true;
		} else {
			vm.customopt = false;
		}
	}
	
	vm.removePoll = function() {
		pollServices.removepoll($routeParams.id, function(data) {
			if(data) {
				$location.path('/');
				$location.replace();
			}
		})
	}
	
	vm.share = function() {
		vm.nameShare = window.encodeURI(vm.poll.polls.name + " || Voting App ");
		vm.urlShare = window.encodeURIComponent(window.location.href);
		window.open("https://twitter.com/intent/tweet?text=" + vm.nameShare + "&url=" + vm.urlShare, "_blank", "toolbar=yes,scrollbars=yes,resizable=yes,top=500,left=500,width=400,height=400");
	}
	
	vm.voting = function() {
		if(!vm.selected) {
			alert('please choose an option');
		} else {
			if(vm.selected == 'I\'d like a custom option') {
				//console.log('newOption', vm.customval);
				var custom = vm.customval;
				pollServices.customopt($routeParams.id, vm.customval, function(data) {
					if(data) {
	 					data.polls.options.push('I\'d like a custom option');
						vm.poll = data;
						pollServices.vote($routeParams.id, vm.customval, function(data) {
							vm.selected = '';
							vm.customval = '';
							vm.customopt = false;
							if(data) {
								alert('voted for ' + custom);
								pollforid();
							} else {
								alert('Error: You can only vote once a poll.');
							}
						});
					} else {
						vm.selected = '';
						vm.customval = '';
						vm.customopt = false;
						alert('Error: You can only vote once a poll.');
					}
				});
			} else {
				//console.log('selected', vm.selected);
				pollServices.vote($routeParams.id, vm.selected, function(data) {
					if(data) {
						alert('voted for ' + vm.selected);
						pollforid();
					} else {
						alert('Error: You can only vote once a poll.');
					}
					vm.selected = '';
				})
			}
		}
	}
});
app.service('pollServices', function($http) {
    
    this.createpoll = function(name, options, callback) {
        $http.post("/createpoll", {"name": name, "options": options}).then(function(response) {
            callback(response.data);
        });
    }
    this.polls = function(callback) {
        $http.get("/readpoll").then(function (response) {
            callback(response.data);
        });
    }
    this.allpolls = function(callback) {
        $http.get("/readallpolls").then(function (response) {
            //console.log(response.data);
            callback(response.data);
        });
    }
    this.pollid = function(id, callback) {
        $http.post("/pollid", {id: id}).then(function(response) {
            callback(response.data);
        });
    }
    this.customopt = function(id, option, callback) {
        $http.post("/custom", {id: id, option: option}).then(function(response) {
            callback(response.data);
        });
    }
    this.vote = function(id, selected, callback) {
        $http.post("/vote", {idPoll: id, selected: selected}).then(function(response) {
            callback(response.data);
        })
    }
    this.removepoll = function(id, callback) {
        $http.post("/removepoll", {id: id}).then(function(response) {
            callback(response.data);
        })
    }
    this.info = function(callback) {
        $http.get("/info").then(function(response) {
            callback(response.data);
        });
    }
    // this.infopath = function(path, callback) {
    //     $http.post("/infopath", {path: path}).then(function(response) {
    //         callback(response.data);
    //     });
    // }
});